import "./App.css";
import "./index.css";
import posterOne from "./images/poster1.jpg";

function App() {
  return (
    <div className="App">
      <a href="#">
        <img src={posterOne} alt="posterOne" />
      </a>
    </div>
  );
}

export default App;
